import { Component } from 'react';
import { Grid, Typography, Button, Stack, Badge, Tooltip } from '@mui/material';
import { styled } from '@mui/material/styles';
import { motion } from 'framer-motion';
import ModalComponent from './components/ModalComponent';
import './App.css';
import { gsap, InertiaPlugin, Draggable, TextPlugin } from 'gsap/all';
import { homePageImageMeta } from './assets/images/homePageImageMeta';
import homePageTitleImg from './assets/homepageTitle.png';

const navData = [
  'Schedule',
  'Travel Requirements',
  'Registry',
  'Gallery',
  'Things To Do',
  'FAQs',
];

const StyledBadge = styled(Badge)`
     & .MuiBadge-badge {
       background-color: #2C3607;
       color: white;
       font-family: 'Sekasfont-Regular';
       font-size: 1em;
     }
   `;
class HomePage extends Component {

  constructor(props) {
    super(props);
    // Check if the user is a wedding guest
    if (localStorage.getItem('isWeddingGuest') !== 'true') {
      window.location.href = '/';
      return;
    }
    this.state = {
      isModalOpen: false,
    };
    this.openModal = this.openModal.bind(this);
    this.closeModal = this.closeModal.bind(this);
  }

  openModal() {
    this.setState({ isModalOpen: true });
  }

  closeModal() {
    this.setState({ isModalOpen: false });
  }

  componentDidMount() {
    // gsap.registerPlugin(Draggable, InertiaPlugin, TextPlugin);

    // Draggable.create('.draggable', {
    //   bounds: '.fullpage-container',
    //   inertia: true,
    //   onClick: () => {
    //     this.openModal();
    //   },
    // });

    // gsap.to('.title-home', {
    //   duration: 3,
    //   text: 'Jade & Seka',
    //   ease: 'power1.out',
    // });
  }


  render() {
    // Helper to render images by section and row
    const renderImages = (section, row) =>
      homePageImageMeta
        .filter((img) => img.position.section === section && img.position.grid.row === row)
        .map((img) => {
          const commonProps = {
            key: img.name,
            alt: img.alt,
            className: 'draggable image-context',
            style: { width: img.width, height: img.height },
          };
          if (img.motion) {
            return (
              <Grid item marginBottom={3} margin={1} key={img.name}>
                <StyledBadge
                  badgeInset="14%"
                  badgeContent={img.key}
                  anchorOrigin={{ vertical:`${img.vertical}`, horizontal:`${img.horizontal}`}}
                >
                  <Tooltip marginRight={1} title={img.name} placement='top'>

                  <motion.img
                    src={img.src}
                    initial={{ opacity: 0 }}
                    animate={{ opacity: 1 }}
                    onClick={this.openModal}
                    transition={{ duration: img.transitionDuration || 2 }}
                    {...commonProps}
                  />
                  </Tooltip>

                </StyledBadge>
              </Grid>
            );
          }
          return (
            <Grid item marginBottom={3} key={img.name}>
              <StyledBadge
                badgeContent={img.key}
                color="primary"
                anchorOrigin={{ vertical: 'bottom', horizontal: 'right' }}
                badgeInset="14%"

              >
                <Tooltip title={img.name} placement='top'>
                <img src={img.src} onClick={this.openModal} alt={img.alt || ''} {...commonProps} />
                </Tooltip>
              </StyledBadge>
            </Grid>
          );
        });

    return (
      <div>
        <Grid
          container
          direction="column"
          justifyContent="center"
          alignItems="center"
          className="fullpage-container"
          style={{ minHeight: '100vh' }}
        >
          <Grid container direction="row" justifyContent="center" alignItems="center" marginBottom={4}>
            <img src={homePageTitleImg} style={{width:330, height:100}} alt="Home Page Title"/>
          </Grid>
          {/* Top images row */}
          <Grid container direction="row" justifyContent="center" spacing={2}>
            {renderImages('top', 1)}
          </Grid>

          {/* Title and Navigation */}
          {/* <Grid justifyContent="center" item>
            <Stack alignItems="center" justifyContent="center">
              <Typography
                sx={{ fontFamily: 'Sekasfont-Regular', fontSize: '5em', fontWeight: 400 }}
                variant="h2"
                align="center"
              >
                Jade & Seka
              </Typography>
              <Button
                justifyContent="center"
                onClick={this.openModal}
                sx={{ fontFamily: 'Sekasfont-Regular', fontSize: '18px', backgroundColor: '#2C3607', color: 'white' }}
              >
                RSVP
              </Button>
              <ol className="nav-inline-list">
                {navData.map((listItem, idx) => [
                  <li key={listItem}>{listItem}</li>,
                  idx === 2 ? <br key="break" /> : null,
                ])}
              </ol>
            </Stack>
          </Grid> */}
           {/* middle images row */}
          <Grid container direction="row" justifyContent="center" spacing={4}>
            {renderImages('middle', 2)}
          </Grid>

          {/* Bottom images row */}
          <Grid container direction="row" justifyContent="center" spacing={4}>
            {renderImages('bottom', 3)}
          </Grid>

          {/* Footer */}
            <Button
                justifyContent="center"
                onClick={this.openModal}
                sx={{
                  fontFamily: 'Sekasfont-Regular',
                  fontSize: 18,
                  backgroundColor: '#2C3607',
                  color: 'white',
                  width: 320,
                  height: 35,
                  borderRadius: 2,
                  mt: 2
                }}
            >
              RSVP
            </Button>
        </Grid>
        {this.state.isModalOpen && (
          <ModalComponent open={this.state.isModalOpen} onClose={this.closeModal}>
            <Typography variant="h6" id="modal-title">
              Modal Title
            </Typography>
            <Typography id="modal-description">
              This is the modal content.
            </Typography>
          </ModalComponent>
        )}
      </div>
    );
  }
}


export default HomePage;
